import React from 'react';
import ReactDOM from 'react-dom';
import GoogleMapReact from 'google-map-react';

export default class Dashboard extends React.Component {

    static defaultProps = {
        center: {
            lat: 59.95,
            long: 30.33
        },
        zoom: 11
    }
    render() {
        return (
            <div>
                Hi User!!!
            </div>        
        );

    }
}
